import React from "react";
import Tarjeta from "./Tarjeta";
import "./vocabulario.css";

function Vocabulario() {
  return (
    <div className="vocabulario-container">
      <Tarjeta palabraEsp="Hola" palabraSue="Hej" />
      <Tarjeta palabraEsp="Gracias" palabraSue="Tack" />
      <Tarjeta palabraEsp="Adiós" palabraSue="Hej då" />
      <Tarjeta palabraEsp="Por favor" palabraSue="Snälla" />
    </div>
  );
}

export default Vocabulario;
